import React, { useState } from 'react'
import image from "../images/pexels-tima-miroshnichenko-6169659.jpg";
import Icons from './Icons';
import myData from '../myData/data.json'
import JsonFetcher from '../JsonFetcher';

function Project() {
    const [jsonData, setJsonData] = useState(null);

    const handleDataFetch = data => {
    setJsonData(data);
  };

  console.log(handleDataFetch);
  return (
    <div>
      <JsonFetcher url="your_file.json" onDataFetch={handleDataFetch} />

      {jsonData && (
        <div>
          <h2>Data Items:</h2>
          {jsonData.map(item => (
            <div key={item.id}>
              <p>ID: {item.id}</p>
              <p>Name: {item.name}</p>
              <p>Description: {item.description}</p>
              {/* Render other properties as needed */}
            </div>
          ))}
        </div>
      )}
    </div>
  )
}

export default Project
